import React from 'react';
import './index.css';
import Todo from './components/todo';



function App(props) {
  const taskList = props.Task.map(item=>
    <Todo 
      key={item.id} 
      name={item.name}
      completed={item.completed}
    />
  );
  return (
    <ul
      role="list"
      className="todo-list stack-large stack-exception"
      aria-labelledby="list-heading">

      {taskList}

    </ul>
  );
}

export default App;
